return ['domain'=>NULL,'plural-forms'=>'nplurals=2; plural=(n != 1);','language'=>'nb','pot-creation-date'=>'2026-02-04 13:07-0600','po-revision-date'=>'2026-02-04 13:07-0600','translation-revision-date'=>'2026-02-04 13:07-0600','project-id-version'=>'ICS Calendar','x-generator'=>'Poedit 3.8','messages'=>['%1$s is currently %2$spaused%3$s, and is not serving calendars on front end pages. You can resume serving calendars under the %4$sUtilities%5$s tab %6$shere%7$s.'=>'%1$s er for øyeblikket %2$spause%3$s, og viser ikke kalendere på frontend-sidene. Du kan gjenoppta visningen av kalendere under fanen %4$sVerktøy%5$s %6$sher%7$s.','%1$sYou are running ICS Calendar in a WordPress Playground implementation.%2$s Because ICS Calendar is intended to run on a web server, some features may be unavailable or may not function properly.'=>'%1$sDu kjører ICS Calendar i en WordPress Playground-implementering.%2$s Fordi ICS Calendar er ment å kjøre på en webserver, kan det hende at enkelte funksjoner ikke er tilgjengelige eller ikke fungerer som de skal.','%1$sYour site is currently using a UTC offset-based timezone setting.%2$s This can produce time display errors in the %3$s plugin in locations that observe Daylight Saving Time. Please %4$schange your timezone setting%5$s to the city nearest your location, in the same timezone, for proper time display. See our %6$sdocumentation%7$s for additional information on this issue.'=>'%1$sNettstedet ditt bruker for øyeblikket en tidssoneinnstilling basert på UTC-offset.%2$s Dette kan føre til feil i tidsvisningen i %3$s-pluginen på steder som følger sommertid. Vennligst %4$sendre tidssoneinnstillingen%5$s til byen nærmest din plassering, i samme tidssone, for riktig tidsvisning. Se vår %6$sdokumentasjon%7$s for mer informasjon om dette problemet.','Important! Your %1$s configuration appears to be exceeding source calendar provider rate limits.'=>'Viktig! Din %1$s konfigurasjon ser ut til å overskride kildekalenderleverandørens hastighetsbegrensninger.','If your calendars are not loading properly, please review your %1$s settings and usage:'=>'Hvis kalenderne dine ikke lastes inn riktig, må du sjekke innstillingene og bruken av %1$s:','Do not use %1$s in your shortcodes. This feature is intended for troubleshooting only, and should not be left on permanently.'=>'Ikke bruk %1$s i kortkodene dine. Denne funksjonen er kun ment for feilsøking og bør ikke være aktivert permanent.','Increase the %1$s %2$sTransient (cache) expiration%3$s setting to %4$s43200%5$s (12 hours) or greater, to reduce the frequency of requests to the provider. (See note below.)'=>'Øk innstillingen %1$s %2$sTransient (cache) expiration%3$s til %4$s43200%5$s (12 timer) eller mer for å redusere hyppigheten av forespørsler til leverandøren. (Se merknad nedenfor.)','Avoid including a large number of feeds (10 or more) from the same provider in a single %1$s shortcode.'=>'Unngå å inkludere et stort antall feeds (10 eller flere) fra samme leverandør i en enkelt %1$s kortkode.','Temporarily pause ICS Calendar on your front-end pages using the %1$sPause Calendars%2$s utility. (24-48 hours is recommended.)'=>'Sett ICS-kalenderen midlertidig på pause på frontend-sidene dine ved hjelp av verktøyet %1$sPause Calendars%2$s. (24–48 timer anbefales.)','%1$s includes built-in caching, specifically to improve performance and avoid exceeding provider rate limits. Circumventing this caching with a very low %2$sreload%3$s setting may trigger a temporary block on your web server IP address, or possibly on your entire hosting network, by the calendar provider.'=>'%1$s inkluderer innebygd caching, spesielt for å forbedre ytelsen og unngå å overskride leverandørens hastighetsbegrensninger. Omgåelse av denne caching med en svært lav %2$sreload%3$s-innstilling kan utløse en midlertidig blokkering av IP-adressen til webserveren din, eller muligens hele hosting-nettverket ditt, av kalenderleverandøren.','After making the recommended changes, please allow up to 24 hours for your calendar provider to remove any temporary blocks on your IP address. If you find that the problem persists, please use our %1$ssupport request form%2$s to contact us, and be sure to include your %3$ssystem report%4$s.'=>'Etter at du har gjort de anbefalte endringene, kan det ta opptil 24 timer før kalendertjenesten fjerner eventuelle midlertidige blokkeringer av IP-adressen din. Hvis problemet vedvarer, kan du bruke vårt %1$ssupportskjema%2$s for å kontakte oss, og husk å legge ved %3$ssystemrapporten%4$s.','Note: Set the %1$sTransient (cache) expiration%2$s as large as possible, considering how frequently event information in your calendar is typically updated. %3$s Remember that you can use the %4$sClear Cached Calendar Data%5$s utility to manually clear the cache at any time, if needed.'=>'Merk: Sett %1$sTransient (cache) expiration%2$s så høyt som mulig, med tanke på hvor ofte hendelsesinformasjonen i kalenderen din vanligvis oppdateres. %3$s Husk at du kan bruke verktøyet %4$sClear Cached Calendar Data%5$s til å tømme hurtigbufferen manuelt når som helst, hvis nødvendig.','%1$sPlease note:%2$s %3$s version 10.6 changes the default options for several shortcode settings. In order to maintain consistency, these new defaults are %4$snot%5$s enabled when upgrading from an earlier version. If you would like to learn more about the changes please read our %6$sblog post%7$s, or to switch to the new defaults, turn on the %8$s option on the %9$s settings%10$s page.'=>'%1$sVær oppmerksom på:%2$s %3$s versjon 10.6 endrer standardinnstillingene for flere kortkodeinnstillinger. For å opprettholde konsistens er disse nye standardinnstillingene %4$sikke%5$s aktivert når du oppgraderer fra en tidligere versjon. Hvis du vil vite mer om endringene, kan du lese %6$sblogginnlegget vårt%7$s, eller hvis du vil bytte til de nye standardinnstillingene, kan du aktivere %8$salternativet på %9$sinnstillingssiden%10$s.','Use new parameter defaults (v.10.6)'=>'Bruk nye standardinnstillinger for parametere (v.10.6)','%1$sPlease note:%2$s %3$s version 11.0 streamlines the way ICS feed URLs are retrieved. This change uses a standard built-in WordPress function, so it should be fully compatible with all existing installations. If you encounter any new issues after upgrading to version 11 or later, please visit the %4$sWordPress Support Forums%5$s for assistance.'=>'%1$sMerk:%2$s %3$s versjon 11.0 strømlinjeformer måten ICS-feed-URL-er hentes på. Denne endringen bruker en standard innebygd WordPress-funksjon, så den bør være fullt kompatibel med alle eksisterende installasjoner. Hvis du støter på nye problemer etter oppgradering til versjon 11 eller senere, kan du besøke %4$sWordPress Support Forums%5$s for å få hjelp.','%1$sPlease note:%2$s %3$s version 11.5.14.2 introduces a new, more secure method for handling calendar parameters when loading via AJAX. Please clear any caching plugins you are using, to ensure that your calendars are loading properly with the new method.'=>'%1$sVær oppmerksom på:%2$s %3$s versjon 11.5.14.2 introduserer en ny, sikrere metode for håndtering av kalenderparametere ved lasting via AJAX. Tøm eventuelle cache-plugins du bruker, for å sikre at kalenderne lastes riktig med den nye metoden.','%1$sWelcome to %2$s version 12!%3$s Version 12.0 introduces additional troubleshooting tools, plus a number of performance improvements and interface refinements throughout. Please see the %4$schangelog%5$s for more details on this update.'=>'%1$sVelkommen til %2$s versjon 12!%3$s Versjon 12.0 introduserer flere feilsøkingsverktøy, samt en rekke ytelsesforbedringer og forbedringer av grensesnittet. Se %4$sendringsloggen%5$s for mer informasjon om denne oppdateringen.','Getting Started'=>'Kom i gang','Settings'=>'Innstillinger','Appearance'=>'Utseende','Utilities'=>'Verktøy','System Report'=>'Hent systemrapport','Support'=>'Brukerstøtte','Upgrade to %1$s!'=>'Oppgrader til %1$s!','Show/hide all'=>'Vis/skjul alt','ICS file 