eeks'=>'Gjentas hver %1$s uke','Recurs weekly'=>'Gjentas ukentlig','Recurs every %1$s days'=>'Gjentas hver %1$s dag','Recurs daily'=>'Gjentas daglig','The "url" property in your %1$s shortcode appears to contain HTML tags; most likely your URL has been turned into a clickable link. Your calendar may not display properly as a result. Please remove the clickable link in the shortcode.'=>'"Url"-egenskapen i din %1$s kortkode ser ut til å inneholde HTML-koder; mest sannsynlig har URL-en din blitt omgjort til en klikkbar lenke. Kalenderen din vises kanskje ikke riktig som følge av dette. Fjern den klikkbare lenken i kortkoden.','The r34ics_url_get_contents() function is no longer supported.'=>'Funksjonen r34ics_url_get_contents() støttes ikke lenger.','Add %1$s'=>'Legg til %1$s','Close'=>'Lukk','ICS Feed URL:'=>'ICS-feed-URL:','Be sure you are using a %1$ssubscribe%2$s URL, not a %3$sweb view%4$s URL.%5$s (Entering the URL directly in your web browser should download an %6$s file.)'=>'Sørg for at du bruker en %1$sabonnements-URL%2$s, ikke en %3$swebvisnings-URL%4$s.%5$s (Hvis du skriver inn URL-en direkte i nettleseren din, bør du kunne laste ned en %6$s-fil.)','Calendar Title:'=>'Kalendertittel:','Leave empty to use calendar&rsquo;s default title. Enter %1$s to omit title altogether.'=>'La feltet stå tomt for å bruke kalenderens standardtittel. Skriv inn %1$s for å utelate tittelen helt.','Calendar Description:'=>'Kalenderbeskrivelse:','Leave empty to use calendar&rsquo;s default description. Enter %1$s to omit description altogether.'=>'La feltet stå tomt for å bruke kalenderens standardbeskrivelse. Skriv inn %1$s for å utelate beskrivelsen helt.','View:'=>'Vis:','month'=>'måned','list'=>'liste','week'=>'uke','Count:'=>'Antall:','Format:'=>'Format:','Leave %1$s blank to include all upcoming events. %2$s must be a standard %3$sPHP date format string%4$s.'=>'La %1$s stå tomt for å inkludere alle kommende hendelser. %2$s må være en standard %3$sPHP-datoformatstreng%4$s.','Show event descriptions %1$s(change to a number in inserted shortcode to set word limit)%2$s'=>'Vis beskrivelser av arrangementer %1$s(endre til et tall i den innsatte kortkoden for å angi ordbegrensning)%2$s','Show event locations %1$s(if available)%2$s'=>'Vis arrangementsteder %1$s(hvis tilgjengelig)%2$s','Show event organizers %1$s(if available)%2$s'=>'Vis arrangører av arrangementet %1$s(hvis tilgjengelig)%2$s','%1$sNote:%2$s Additional %3$sdisplay options%4$s are available by manually editing the shortcode after insertion.'=>'%1$sMerknad:%2$s Ytterligere %3$svisningsalternativer%4$s er tilgjengelige ved å redigere kortkoden manuelt etter innsetting.','Insert %1$s'=>'Sett inn %1$s','Do even more with %1$s version 6!'=>'Gjør enda mer med %1$s versjon 6!','Calendar Builder + Block Editor'=>'Kalenderbygger + blokkeringsredigerer','Configure all calendar settings with an easy visual interface, and use the new %1$s block to select your saved calendars from a dropdown in the Block Editor, no shortcode needed! %2$sLearn more...%3$s'=>'Konfigurer alle kalenderinnstillinger med et enkelt visuelt grensesnitt, og bruk den nye %1$s-blokken til å velge dine lagrede kalendere fra en rullegardinmeny i blokkeringsredigereren, uten behov for kortkode! %2$sLær mer...%3$s','Additional Views and Enhanced Features'=>'Ekstra visninger og forbedrede funksjoner','%1$s offers many new ways to display your calendar, including integrations with the popular %2$s and %3$s open source libraries. Month and year views with a sidebar for the selected day. "Up Next" works great for radio or TV station schedules. Widget and year availability are perfect for holiday bookings. Plus, additional capabilities are added to the core Month, Basic, List and Week views. %4$sView sample calendars...%5$s'=>'%1$s tilbyr mange nye måter å vise kalenderen din på, inkludert integrasjoner med de populære %2$s og %3$s åpne kildekodebibliotekene. Måneds- og årsvisninger med en sidebar for den valgte dagen. «Up Next» fungerer utmerket for radio- eller TV-stasjoners programoversikter. Widget og årlig tilgjengelighet er perfekt for feriebestillinger. I tillegg er det lagt til flere funksjoner i de grunnleggende visningene Måned, Grunnleggende, Liste og Uke. %4$sSe eksempler på kalendere...%5$s','Customization'=>'Tilpasning','Easy-to-use tools to completely customize your calendar colors, typography and more. Select one of our preset color palettes or create your own, with options to individually customize the color of each element in the calendar layout. Choose between your theme fonts, system fonts, or more than 20 included open source fonts. %1$sLearn more...%2$s'=>'Brukervennlige verktøy for å tilpasse kalenderfarger, typografi og mer. Velg en av våre forhåndsinnstilte fargepaletter eller lag din egen, med muligheter for å tilpasse fargen på hvert element i kalenderoppsettet individuelt. Velg mellom temafonter, systemfonter eller mer enn 20 inkluderte åpne kildekodefonter. %1$sLær mer...%2$s','ICS Events'=>'ICS-arrangementer','Turns %1$s into a full calendar management system. Create and edit new events directly in WordPress, and even integrate them seamlessly with your existing external ICS feeds. %2$sLearn more...%3$s'=>'Gjør %1$s til et komplett kalenderadministrasjonssystem. Opprett og rediger nye hendelser direkte i WordPress, og integrer dem sømløst med eksisterende eksterne ICS-feeder. %2$sLær mer...%3$s','Localized Admin Interface'=>'Lokalisert administrasjonsgrensesnitt','All %1$s admin pages are translated into dozens of languages, including English, Czech, Danish, German, Greek, Spanish, Estonian, Finnish, French, Hungarian, Italian, Japanese, Korean, Lithuanian, Latvian, Norwegian, Dutch, Polish, Portuguese, Romanian, Russian, Slovak, Serbian, Swedish, Turkish, Ukrainian, and Chinese.'=>'Alle %1$s administrasjonssider er oversatt til dusinvis av språk, herunder engelsk, tsjekkisk, dansk, tysk, gresk, spansk, estisk, finsk, fransk, ungarsk, italiensk, japansk, koreansk, litauisk, latvisk, norsk, nederlandsk, polsk, portugisisk, rumensk, russisk, slovakisk, serbisk, svensk, tyrkisk, ukrainsk og kinesisk.','Visit %1$s to learn more.'=>'Besøk %1$s for å lære mer.','Calendar Builder screenshot'=>'Skjermbilde av Kalenderbygger','Appearance screenshot'=>'Skjermbilde av utseende','Available now!'=>'Tilgjengelig nå!','Get %1$s!'=>'Få %1$s!','Extensive color palette and typography options are available with %1$s. %2$sLearn More%3$s'=>'Omfattende fargepalett og typografivalg er tilgjengelig med %1$s. %2$sLær mer%3$s','Color Palette'=>'Fargepalett','Match calendar color palette to current Block Theme colors'=>'Tilpass fargepaletten i kalenderen til gjeldende blokktema-farger','beta'=>'beta','Replaces the %1$s default neutral color palette with nearest matches from the current Site Editor Styles color palette or the %2$s file in your theme. Color selections are algorithmic, and some combinations may not pass accessibility contrast tests. This setting has no effect if you are using a "classic" theme that does not include a %3$s file.'=>'Erstatt den %1$s standard nøytrale fargepaletten med nærmeste treff fra den gjeldende fargepaletten i Site Editor Styles eller %2$s-filen i temaet ditt. Fargevalgene er algoritmiske, og noen kombinasjoner kan ikke bestå kontrasttester for tilgjengelighet. Denne innstillingen har ingen effekt hvis du bruker et «klassisk» tema som ikke inkluderer en %3$s-fil.','%1$sThis is currently a beta feature.%2$s It may require making some adjustments to your calendar appearance or CSS for optimal display, especially if you have color-coded your feeds. Functionality is subject to change.'=>'%1$sDette er foreløpig en betafunksjon.%2$s Det kan være nødvendig å gjøre noen justeringer i kalenderen eller CSS for optimal visning, spesielt hvis du har fargekodet feedene dine. Funksjonaliteten kan endres.','Dark mode'=>'Mørk modus','Inverts color palette (light colors on a dark background).'=>'Inverterer fargepaletten (lyse farger på mørk bakgrunn).','Save Changes'=>'Lagre endringer','Thank you for installing %1$s. Before creating your first calendar shortcode, please visit your %2$sGeneral Settings%3$s page and verify that your site language, timezone and date/time format settings are correct. See our %4$sUser Guide%5$s for more information.'=>'Takk for at du installerte %1$s. Før du oppretter din første kalender-kortkode, må du gå til siden %2$sGenerelle innstillinger%3$s og kontrollere at innstillingene for språk, tidssone og dato-/tidsformat på nettstedet ditt er riktige. Se vår %4$sbrukerveiledning%5$s for mer informasjon.','Get started with %1$s in four easy steps... and you\'ve already completed step one! Check out our %2$sQuick Start Guide%3$s for the rest.'=>'Kom i gang med %1$s i fire enkle trinn... og du har allerede fullført trinn én! Sjekk ut vår %2$shurtigstartguide%3$s for resten.','Quick Start Guide'=>'Hurtigstartguide','An extensive %1$sUser Guide%2$s is available on our website. Below are some quick links to key resources in the documentation.'=>'En omfattende %1$sbrukerveiledning%2$s er tilgjengelig på vår nettside. Nedenfor finner du noen hurtiglenker til viktige ressurser i dokumentasjonen.','General:'=>'Generelt:','General WordPress Settings'=>'Generelle WordPress-innstillinger','%1$s Settings'=>'%1$s Innstillinger','Working with Shortcodes:'=>'Arbeide med kortkoder:','Shortcode Overview'=>'Oversikt over kortkoder','Shortcode Builder'=>'Kortkodebygger','Shortcode Parameters Reference'=>'Referanse for kortkodeparametere','Advanced Topics:'=>'Avanserte emner:','FAQs and Tips'=>'Ofte stilte spørsmål og tips','CSS Guide'=>'CSS-veiledning','Developer Resources'=>'Utviklerressurser','GDPR'=>'GDPR','Loading'=>'Laster','Always use AJAX to render calendars'=>'Bruk alltid AJAX til å gjengi kalendere','AJAX loading is now automatic. You can override AJAX, if necessary, by adding %1$s to your shortcode.'=>'AJAX-innlasting skjer nå automatisk. Du kan om nødvendig overstyre AJAX ved å legge til %1$s i kortkoden din.','Increase memory limit when rendering calendars'=>'Øk minnegrensen ved gjengivelse av kalendere','If your calendar is failing to load with an "out of memory" fatal error, try increasing the memory limit. A minimum of 512 MB is recommended. %1$s Notes: 1) Some hosting providers may not allow applications to override the server default setting. 2) It is not possible to set this option lower than the current default memory limit on your server.'=>'Hvis kalenderen din ikke lastes inn og du får en alvorlig feilmelding om «minnefull», kan du prøve å øke minnegrensen. Det anbefales minimum 512 MB. %1$s Merknader: 1) Noen webhotellleverandører tillater ikke at applikasjoner overstyrer serverens standardinnstillinger. 2) Det er ikke mulig å angi denne innstillingen lavere enn den gjeldende standardminnegrensen på serveren din.','deprecated'=>'utgått','Some servers may not support the default feed request method. If your feeds are not loading, turn on this option to use the legacy request method. This feature is deprecated and will be removed in a future update.'=>'Noen servere støtter kanskje ikke standardmetoden for feed-forespørsler. Hvis feedene dine ikke lastes inn, kan du aktivere denne funksjonen for å bruke den gamle forespørselsmetoden. Denne funksjonen er utdatert og vil bli fjernet i en fremtidig oppdatering.','Default shortcode'=>'Standard kortkode','If your site will include a large number of similarly configured calendar shortcodes, you can enter a default "base" shortcode here with the parameters that should be the same for all of the calendars. Individual shortcodes on the site can then include only the parameters that are unique to that calendar, as such: %1$s Any parameters included in the individual shortcode will override what is set here.'=>'Hvis nettstedet ditt vil inneholde et stort antall kortkoder for kalendere med lignende konfigurasjon, kan du angi en standard «basiskortkode» her med parametrene som skal være de samme for alle kalenderne. Individuelle kortkoder på nettstedet kan da bare inneholde parametrene som er unike for den kalenderen, slik som: %1$s Alle parametere som er inkludert i den individuelle kortkoden, vil overstyre det som er angitt her.','Allow access to these hostnames that resolve to reserved IP addresses'=>'Tillat tilgang til disse vertsnavnene som løser til reserverte IP-adresser','If your calendar server is hosted on the same physical server as your website, is part of the same local network, or otherwise uses a %1$sreserved IP address%2$s, enter its hostname here to allow access. For multiple calendar servers, enter one hostname per line. See %3$sthe %4$s documentation%5$s for more information.'=>'Hvis kalenderserveren din er hostet på samme fysiske server som nettstedet ditt, er en del av samme lokale nettverk eller på annen måte bruker en %1$sreservert IP-adresse%2$s, angir du vertsnavnet her for å gi tilgang. For flere kalenderservere angir du ett vertsnavn per linje. Se %3$sdokumentasjonen%4$s%5$s for mer informasjon.','Enter one hostname per line. Hostnames are the base domain name, not a full URL. %1$s For example, you would enter %2$s, not %3$s.'=>'Skriv inn ett vertsnavn per linje. Vertsnavn er basisdomenenavnet, ikke en fullstendig URL. %1$s For eksempel skriver du inn %2$s, ikke %3$s.','Allow access to these ports'=>'Tillat tilgang til disse portene','WordPress automatically allows access to ports 80, 443, and 8080. If you need to be able to access source calendars that use non-standard ports, enter the port numbers here, separated by commas.'=>'WordPress gir automatisk tilgang til portene 80, 443 og 8080. Hvis du trenger tilgang til kildekalendere som bruker ikke-standardiserte porter, kan du skrive inn portnumrene her, atskilt med komma.','Caching'=>'Caching','Transient (cache) expiration'=>'Utløp av midlertidig (cache)','seconds'=>'sekunder','Sets how long calendar feed data should be cached on the server (WordPress transients) before reloading. Default is 3600 (1 hour). Minimum allowed value is 120 (2 minutes).'=>'Angir hvor lenge kalenderfeedsdata skal lagres i hurtigbufferen på serveren (WordPress transients) før de lastes inn på nytt. Standardverdien er 3600 (1 time). Minste tillatte verdi er 120 (2 minutter).','Admin'=>'Admin','Minimum access role'=>'Minimum tilgangsrolle','Identifies the minimum user role that is allowed to access %1$s admin pages. Certain areas such as Settings are further restricted to %2$s users only (%3$s users on Multisite configurations).'=>'Identifiserer den minste brukerrollen som har tilgang til %1$s administrasjonssider. Visse områder, for eksempel Innstillinger, er ytterligere begrenset til %2$s brukere (%3$s brukere på Multisite-konfigurasjoner).','Register Customizer'=>'Registrer tilpasningsverktøy','WordPress no longer includes a link to the Customizer in the Appearance menu when a Block Theme is active. Check this box if you wish to use the Customizer, e.g. for the Additional CSS input. Note: Some themes or plugins may already register the Customizer, in which case, this setting will have no effect. (The checkbox only enables the Customizer when checked; it does not disable the Customizer when unchecked.'=>'WordPress inkluderer ikke lenger en lenke til Customizer i Utseende-menyen når et blokktema er aktivt. Merk av i denne boksen hvis du ønsker å bruke Customizer, f.eks. for å legge til ekstra CSS. Merk: Noen temaer eller plugins kan allerede registrere Customizer, og i så fall vil denne innstillingen ikke ha noen effekt. (Avmerkingsboksen aktiverer bare Customizer når den er merket av; den deaktiverer ikke Customizer når den ikke er merket av.','Remove "Add ICS Calendar" button in Classic Editor'=>'Fjern knappen «Legg til ICS-kalender» i Classic Editor','By default, ICS Calendar adds an "Add ICS Calendar" button to the toolbar above the WYSIWYG editor when using Classic Editor. Check this box to remove the button. Has no effect on sites using the Block Editor (Gutenberg).'=>'Som standard legger ICS Calendar til en «Legg til ICS Calendar»-knapp i verktøylinjen over WYSIWYG-redigeringsprogrammet når du bruker Classic Editor. Merk av i denne boksen for å fjerne knappen. Har ingen effekt på nettsteder som bruker Block Editor (Gutenberg).','%1$s version 10.6 introduced new default values for several shortcode parameters. New installations automatically use the new default values, but upgraded installations will continue to use the old default values, unless this box is checked. Read more about these changes on %2$sour blog%3$s.'=>'%1$s versjon 10.6 introduserte nye standardverdier for flere kortkodeparametere. Nye installasjoner bruker automatisk de nye standardverdiene, men oppgraderte installasjoner vil fortsette å bruke de gamle standardverdiene, med mindre denne boksen er merket av. Les mer om disse endringene på %2$sbloggen vår%3$s.','User Guide'=>'Brukerhåndbok','Our complete user guide is available with full translation into dozens of languages on our website:'=>'Vår komplette brukerveiledning er tilgjengelig med full oversettelse til dusinvis av språk på vår nettside:','For assistance, please use our %1$ssupport request form%2$s.'=>'For hjelp, vennligst bruk vårt %1$ssupportskjema%2$s.','When contacting support, please include the %1$ssystem report%2$s from this page.'=>'Når du kontakter kundestøtte, vennligst legg ved %1$ssystemrapporten%2$s fra denne siden.','Spread the word!'=>'Spre ordet!!','If you find %1$s useful, you can help support our continued growth and development with a %2$sfive-star review%3$s. Thank you!'=>'Hvis du synes %1$s er nyttig, kan du bidra til vår videre vekst og utvikling ved å gi oss en %2$sfemstjerners vurdering%3$s. Takk!','Calendar Status: %1$sPaused%2$s'=>'Kalenderstatus: %1$sPauset%2$s','Calendar Status: %1$sActive%2$s'=>'Kalenderstatus: %1$sAktiv%2$s','Use the pause button if you need to temporarily turn off %1$s on your front end pages.'=>'Bruk pauseknappen hvis du trenger å slå av %1$s midlertidig på frontend-sidene dine.','Resume Calendars'=>'CV-kalendere','Pause Calendars'=>'Pause kalendere','No content will be altered, but your calendars will be hidden and no %1$s asset files (JavaScript, CSS) will be loaded on front-end pages. If you are using caching via a plugin or through your hosting provider, you may need to clear the cache after changing this setting.'=>'Innholdet vil ikke bli endret, men kalenderne dine vil bli skjult og ingen %1$s ressursfiler (JavaScript, CSS) vil bli lastet inn på frontend-sidene. Hvis du bruker caching via et plugin eller gjennom din hostingleverandør, kan det hende du må tømme cachen etter å ha endret denne innstillingen.','%1$s Data Cache'=>'%1$s Datacache','This will immediately clear all existing cached calendar data (purge transients), forcing WordPress to reload all calendars the next time they are viewed. Caching will then resume as before.'=>'Dette vil umiddelbart slette alle eksisterende cache-lagrede kalenderdata (purge transients), og tvinge WordPress til å laste inn alle kalendere på nytt neste gang de vises. Caching vil deretter fortsette som før.','Clear Cached Calendar Data'=>'Tøm cache-data for kalender','If you are using a third-party caching plugin, you may need to clear your site-wide cache after running this utility.'=>'Hvis du bruker et tredjeparts cache-plugin, kan det hende du må tømme cachen for hele nettstedet etter å ha kjørt dette verktøyet.','Are you sure? This will reset all %1$s settings to their defaults. Your saved calendar configurations and shortcodes will be retained, but resetting the defaults may change the appearance of your calendars. If you are using a third-party caching plugin, you may need to clear your site-wide cache after running this utility.'=>'Er du sikker? Dette vil tilbakestille alle %1$s innstillinger til standardinnstillingene. Dine lagrede kalenderkonfigurasjoner og kortkoder vil bli beholdt, men tilbakestilling av standardinnstillingene kan endre utseendet på kalenderne dine. Hvis du bruker et tredjeparts cache-plugin, må du kanskje tømme cachen for hele nettstedet etter å ha kjørt dette verktøyet.','Only clear transients (default)'=>'Bare klare transienter (standard)','Also clear all saved ICS feed URLs'=>'Slett også alle lagrede ICS-feed-URL-er','Reset %1$sall%2$s %3$s settings (including transients and feed URLs)'=>'Tilbakestill %1$salle%2$s %3$s innstillinger (inkludert transienter og feed-URL-er)','Last cleared:'=>'Sist ryddet:','never'=>'aldri','ICS Feed URL Tester'=>'ICS-feed-URL-tester','If you are concerned that the plugin is not properly retrieving your feed, you can test the URL here.'=>'Hvis du er bekymret for at plugin-modulen ikke henter inn feedet ditt riktig, kan du teste URL-en her.','Enter feed URL...'=>'Skriv inn feed-URL...','Test URL'=>'Test-URL','Results:'=>'Resultater:','%1$s received.'=>'%1$s mottatt.','This appears to be a valid ICS feed URL.'=>'Dette ser ut til å være en gyldig ICS-feed-URL.','unknown'=>'ukjent','This does not appear to be a valid ICS feed URL.'=>'Dette ser ikke ut til å være en gyldig ICS-feed-URL.','Could not retrieve data from the requested URL.'=>'Kunne ikke hente data fra den forespurte URL-adressen.','An unknown error occurred while attempting to retrieve the requested URL.'=>'Det oppstod en ukjent feil under forsøket på å hente den forespurte URL-adressen.','Please copy the following text and include it in your message when emailing support.'=>'Kopier følgende tekst og inkluder den i meldingen din når du sender en e-post til kundestøtte.','Also please include the %1$s shortcode exactly as you have it entered on the affected page.'=>'Vennligst inkluder også %1$s kortkoden nøyaktig slik du har angitt den på den berørte siden.','No events found.'=>'Ingen dager funnet','Previous Page'=>'Forrige side','Next Page'=>'Neste side','All Day'=>'Hele dagen','Previous Month'=>'Forrige måned','Next Month'=>'Neste måned','Today'=>'I dag','Month selection'=>'Valg av måned','No events.'=>'Ingen hendelser.','No additional events this month.'=>'Ingen ekstra arrangementer denne måneden.','Week selection'=>'Valg av uke','Last week'=>'Forrige uke','This week'=>'Nåværende uke','Next week'=>'Neste uke','ICS Calendar'=>'ICS Calendar','https://icscalendar.com'=>'https://icscalendar.com','Turn your Google Calendar, Microsoft Office 365 or Apple iCloud Calendar into a seamlessly integrated, auto-updating, zero-maintenance WordPress experience.'=>'Gjør Google Kalender, Microsoft Office 365 eller Apple iCloud Kalender til en sømløst integrert, automatisk oppdatert WordPress-opplevelse som ikke krever vedlikehold.','Room 34 Creative Services, LLC'=>'Room 34 Creative Services, LLC']];
